import React, { useState } from 'react';
import { Box, Button, Select, MenuItem, Typography } from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import UploadFileIcon from '@mui/icons-material/UploadFile';
import DownloadIcon from '@mui/icons-material/Download';
import CategoryEditor from './CategoryEditor';

export default function Navbar({ data, year, onYearChange, addCategory, exportJSON, importJSONFile, fileInputRef, deleteCategory, onDragStartCat, clearAll, PALETTE, updateCategory }){
  const [editorOpen, setEditorOpen] = useState(false);
  const [editorInitial, setEditorInitial] = useState(null);

  function openCreate(){ setEditorInitial(null); setEditorOpen(true); }
  function openEdit(cat){ setEditorInitial(cat); setEditorOpen(true); }

  return (
    <Box className="navbar">
      <Typography variant="h6">Time Off Planner</Typography>

      <Typography sx={{mt:2}} className="label">Year</Typography>
      <Select value={year} onChange={(e)=> onYearChange(+e.target.value)}>
        {Array.from({length:7}).map((_,i)=> {
          const y = year - 3 + i;
          return <MenuItem key={y} value={y}>{y}</MenuItem>;
        })}
      </Select>

      <Typography className="label" sx={{mt:2}}>Categories</Typography>
      <Box id="categories">
        {/* Ghost "create" category inline */}
        <Box key="__create" className="category" onClick={()=>openCreate()} sx={{cursor:'pointer',opacity:0.85}}>
          <Box sx={{width:38,height:38, borderRadius:1, background:'linear-gradient(135deg,#eef2ff,#e6f2ff)',display:'flex',alignItems:'center',justifyContent:'center',color:'var(--muted)'}}>+</Box>
          <Box className="meta" sx={{flex:1}}>
            <div className="name" style={{color:'var(--muted)'}}>Add new category</div>
            <div className="qty" style={{color:'var(--muted)'}}>Click to create</div>
          </Box>
          <Box className="actions">
            <Button size="small" className="small-btn">Create</Button>
          </Box>
        </Box>

        {data.categories.map(cat=>{
          const used = cat.used || 0;
          const remaining = Math.max(0, cat.qty - used);
          return (
            <Box key={cat.id} className="category" draggable onDragStart={(e)=>onDragStartCat(e, cat)}>
              <Box sx={{width:38,height:38, borderRadius:1, background:cat.color}} onClick={()=>openEdit(cat)} />
              <Box className="meta" sx={{flex:1}} onClick={()=>openEdit(cat)}>
                <div className="name">{cat.name}</div>
                <div className="qty">{remaining}/{cat.qty} remaining</div>
              </Box>
              <Box className="actions">
                <Button size="small" onClick={(e)=>{ e.stopPropagation(); openEdit(cat); }} className="small-btn">Edit</Button>
              </Box>
            </Box>
          );
        })}
      </Box>

      <div className="footer-note">Drag a category square to any day. Click a filled day to remove, swap, or convert to half-day.</div>
      <Box sx={{mt:2}} >
        <Button variant="outlined" className="small-btn" onClick={clearAll}>Clear All</Button>
      </Box>

      {/* import/export moved to bottom */}
      <Box sx={{mt:3,display:'flex',gap:1}}>
        <Button variant="outlined" startIcon={<DownloadIcon />} onClick={exportJSON}>Export</Button>
        <Button variant="outlined" startIcon={<UploadFileIcon />} onClick={()=>fileInputRef.current && fileInputRef.current.click()}>Import</Button>
        <input ref={fileInputRef} type="file" accept="application/json" style={{display:'none'}} onChange={(e)=> importJSONFile(e.target.files)} />
      </Box>

      <CategoryEditor
        open={editorOpen}
        onClose={()=>setEditorOpen(false)}
        initial={editorInitial || {}}
        PALETTE={PALETTE}
        onSave={(payload)=>{
          if(payload.id) updateCategory(payload.id, payload.name, payload.qty, payload.color);
          else addCategory && addCategory(payload.name, payload.qty, payload.color);
        }}
        onDelete={(id)=> deleteCategory(id)}
      />
    </Box>
  );
}
